(814, 'elementor_remote_info_feed_data', 'a:5:{i:0;a:5:{s:5:\"title\";s:58:\"The New Rank Math SEO Integration for Elementor Explained \";s:7:\"excerpt\";s:253:\"With Rank Math\'s new integration for Elementor you can get SEO suggestions, edit your meta snippet accordingly, and configure the schema markup — all from within Elementor\'s editing screen. In this article, we’ll walk you through these new features.\";s:7:\"created\";s:10:\"1588245311\";s:5:\"badge\";s:0:\"\";s:3:\"url\";s:121:\"https://elementor.com/blog/rank-math-integration/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:1;a:5:{s:5:\"title\";s:91:\"Monday Masterclass: How to Transform Any WordPress Site Into an Online Store With Elementor\";s:7:\"excerpt\";s:179:\"This week we turn a WordPress site into an online store with customizable product display, and an efficient system for shipping and registering orders, all done in 5 simple steps.\";s:7:\"created\";s:10:\"1588065572\";s:5:\"badge\";s:0:\"\";s:3:\"url\";s:135:\"https://elementor.com/blog/wordpress-site-into-an-online-store/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:2;a:5:{s:5:\"title\";s:56:\"Monthly Templates Kit #9: The Online Course Template Kit\";s:7:\"excerpt\";s:274:\"Meet our Online Course Website template kit, which we built for professionals looking to create and publish an online video course on WordPress. It only takes minutes to upload your video content and materials so that you can share your skill set with the world of learners.\";s:7:\"created\";s:10:\"1587538951\";s:5:\"badge\";s:0:\"\";s:3:\"url\";s:126:\"https://elementor.com/blog/online-course-template-kit/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:3;a:5:{s:5:\"title\";s:43:\"Elementor Sites of the Month – March 2020\";s:7:\"excerpt\";s:73:\"Here are our top picks of Elementor sites for March 2020. Check them out!\";s:7:\"created\";s:10:\"1587480146\";s:5:\"badge\";s:0:\"\";s:3:\"url\";s:119:\"https://elementor.com/blog/showcase-march-2020/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:4;a:5:{s:5:\"title\";s:61:\"How to Design Your WordPress Site Using Elementor Theme Style\";s:7:\"excerpt\";s:177:\"Elementor Theme Style allows you to customize your website easily. In this tutorial, we’ll show you how to use the theme style to quickly build a unique and compelling design.\";s:7:\"created\";s:10:\"1586863421\";s:5:\"badge\";s:0:\"\";s:3:\"url\";s:148:\"https://elementor.com/blog/design-your-wordpress-site-elementor-theme-style/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}}', 'no'),
